export default class Counter extends React.Component { 
    
    
constructor() { super(); this.state = {
    counter: 0 };
}    
    
render() {
return (
 <div>
 <button>-</button>
 <output>{this.state.counter}</output>
 <button>+</button>
 </div>
 );
 }
}
